import React from 'react';
import {Row, Col, Avatar, Button} from 'antd'

function _UserInfo() {
    return (
        <Row>
            <Col>
                <Avatar>
                    hình
                </Avatar>
            </Col>
            <Col>
                <Button>Đăng Xuất</Button>
            </Col>
        </Row>
    );
}

export default _UserInfo;
